-- Desabilitar RLS temporariamente para permitir a importação de dados sem restrições de usuário
ALTER TABLE bancos DISABLE ROW LEVEL SECURITY;
ALTER TABLE cartoes DISABLE ROW LEVEL SECURITY;
ALTER TABLE categorias DISABLE ROW LEVEL SECURITY;
ALTER TABLE receitas DISABLE ROW LEVEL SECURITY;
ALTER TABLE despesas DISABLE ROW LEVEL SECURITY;
ALTER TABLE despesa_parcelas DISABLE ROW LEVEL SECURITY;


-- Reabilitar RLS após a importação
ALTER TABLE bancos ENABLE ROW LEVEL SECURITY;
ALTER TABLE cartoes ENABLE ROW LEVEL SECURITY;
ALTER TABLE categorias ENABLE ROW LEVEL SECURITY;
ALTER TABLE receitas ENABLE ROW LEVEL SECURITY;
ALTER TABLE despesas ENABLE ROW LEVEL SECURITY;
ALTER TABLE despesa_parcelas ENABLE ROW LEVEL SECURITY;
